const double ORDER2[] = {1.0/16384, 1.0/4096 ,1.0/1024 , 1.0/256, 1.0/64, 1.0/16, 0.25, 1.0};

inline int divergent(const double &x,const double &y,const double &z){
    return ((x-y)>z || (y-x)>z);
}

inline int cut(double &v, const double &max, const double &min){
    if(v>max) v = max;
    else if(v<min) v = min;
    else return 0;
    return 1;
}


// x = interp1(df, snr, target_df)
void interp1(const double &target, double &value){
    int i  = 0;
    for(i=0;i<DATA_LEN;++i){
        if(df[i]<=target && df[i+1]>target){
            value = snr[i] + (snr[i+1]-snr[i])/(df[i+1]-df[i])*(target-df[i]);
            return;
        }
    }
}
// y = interp1(snr,fr, gamma)
void interp2(const double &gamma, double &value){
    int i  = 0;
    for(i=0;i<FR_DATA_LEN;++i){
        if(r[i]<=gamma && r[i+1]>gamma){
            value = fr[i] + (fr[i+1]-fr[i])/(r[i+1]-r[i])*(gamma-r[i]);
            return;
        }
    }
}

void weight_predict_minMSE(double* weights, const double &gamma){

    double lambda = 15, targetSum = PXL, tmpSum = 0.0, tollerance = 0.001, slope ;
    double value = 0.0;
    int i,j;
    for(i = 0 ; i < PXL ; ++i){
        value = -lambda*ORDER2[i]/gamma;
        cut(value,MAX_DF,MIN_DF);
        interp1(value,weights[i]);
        weights[i]/=gamma;
        tmpSum+=weights[i];
    }

    double delta = 0.01/gamma;
    int iter = 1, flag = 1, limit = 100, cutter = 0;

    while(divergent(tmpSum,targetSum,tollerance)){
        printf("Iter:#%d,lambda=%lf (%lf) weights:[",iter,lambda,tmpSum);
        for(i=0;i<PXL;++i)
            printf("%lf, ",weights[i]);
        printf("]\n");

        // calculate slope
        slope = 0.0;
        cutter = 0;
        if(flag){
            for(i=0;i<PXL;++i){
                value = -(lambda+delta)*ORDER2[i]/gamma;
                cutter+=cut(value,MAX_DF,MIN_DF);
                interp1(value,weights[i]);
                weights[i]/=gamma;
                slope+=weights[i];
            }
            slope = (slope-tmpSum)/delta;
        }

        if(divergent(slope,0,tollerance)){
            printf("diverge:%lf\n",slope);
            lambda += (targetSum-tmpSum)/slope;
        }
        else{
            lambda += ((targetSum < tmpSum)*2-1)*delta*((cutter==PXL-1)+1);
        }

        tmpSum = 0.0;
        for(i = 0 ; i < PXL ; ++i){
            value = -lambda*ORDER2[i]/gamma;
            cut(value,MAX_DF,MIN_DF);
            interp1(value,weights[i]);
            weights[i]/=gamma;
            tmpSum+=weights[i];
        }
        iter+=1;

        if(flag && !divergent(tmpSum,targetSum,10*tollerance)){
            delta/=3;
            flag = 0;
        }

        if(iter>limit && !divergent(tmpSum,targetSum,1)){
            if(cutter==0)
                delta/=1.05;
            else
                delta*=1.05;
            limit+=200;
        }
    }

    printf("found weights solution:((%lf)[",tmpSum);
    for(i=0;i<PXL;++i)
        printf("%lf, ",weights[i]);
    printf("]\n");

}


